import React, { useState, useEffect } from 'react';
import axios from 'axios';

const NuevoPedidoForm = ({ onPedidoAgregado }) => {
  const [nuevoPedido, setNuevoPedido] = useState({
    fecha_creacion: '',
    fecha_pedido: '',
    total_pedido: 0,
    estado_pedido: 'por hacer',
    productos: null, // Aquí almacenaremos la información del producto seleccionado
    servicios: null, // Aquí almacenaremos la información del servicio seleccionado
  });

  // Utiliza useEffect para actualizar la fecha_creacion al montar el componente
  useEffect(() => {
    const fechaCreacionActual = new Date().toISOString().split('T')[0];
    setNuevoPedido((prevPedido) => ({
      ...prevPedido,
      fecha_creacion: fechaCreacionActual,
      fecha_pedido: new Date(new Date(fechaCreacionActual).getTime() + 5 * 24 * 60 * 60 * 1000)
        .toISOString()
        .split('T')[0],
    }));
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNuevoPedido((prevPedido) => ({
      ...prevPedido,
      [name]: value,
    }));
  };

  const handleProductoChange = (selectedProducto) => {
    // Actualizamos el estado con la información del producto seleccionado
    setNuevoPedido((prevPedido) => ({
      ...prevPedido,
      productos: selectedProducto,
    }));
  };

  const handleServicioChange = (selectedServicio) => {
    // Actualizamos el estado con la información del servicio seleccionado
    setNuevoPedido((prevPedido) => ({
      ...prevPedido,
      servicios: selectedServicio,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Realizar la solicitud POST a la API para agregar un nuevo pedido
      const response = await axios.post('http://localhost:3000/pedidos', nuevoPedido);
      onPedidoAgregado(response.data); // Llama a la función proporcionada para actualizar el estado de pedidos en la lista
      setNuevoPedido({
        fecha_creacion: '',
        fecha_pedido: '',
        total_pedido: 0,
        estado_pedido: 'por hacer',
        productos: null,
        servicios: null,
      });
    } catch (error) {
      console.error('Error al agregar un nuevo pedido:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>Fecha de Creación:</label>
      <input
        type="date"
        name="fecha_creacion"
        value={nuevoPedido.fecha_creacion}
        onChange={handleInputChange}
        readOnly
      />

      <label>Fecha de Pedido:</label>
      <input
        type="date"
        name="fecha_pedido"
        value={nuevoPedido.fecha_pedido}
        onChange={handleInputChange}
        min={nuevoPedido.fecha_creacion}
      />

      <label>Total Pedido:</label>
      <input
        type="number"
        name="total_pedido"
        value={nuevoPedido.total_pedido}
        onChange={handleInputChange}
      />

      <div>
        <label>Producto:</label>
        <select onChange={(e) => handleProductoChange(JSON.parse(e.target.value))}>
          <option value="">Seleccione un producto</option>
          <option value={JSON.stringify(arrayMediasEscolares)}>Medias Escolares</option>
          <option value={JSON.stringify(arrayCamisetaBasica)}>Camiseta Básica</option>
          {/* Agrega más opciones según tus necesidades */}
        </select>
      </div>

      <div>
        <label>Servicio:</label>
        <select onChange={(e) => handleServicioChange(JSON.parse(e.target.value))}>
          <option value="">Seleccione un servicio</option>
          <option value={JSON.stringify(arrayMunecoPorcelanicron)}>Muñeco de Porcelanicron</option>
          <option value={JSON.stringify(arrayEntubarPantalon)}>Entubar Pantalón</option>
          {/* Agrega más opciones según tus necesidades */}
        </select>
      </div>

      <button type="submit">Agregar Pedido</button>
    </form>
  );
};

export default NuevoPedidoForm;
